  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 800
      }
    }
  }
}

class App extends React.Component {
  render(){return (
    <div>
      <Header>
      <Header className="header-color" title={<Link style={{textDecoration: 'none', color: 'white'}} to="/">Sports Finder</Link>} scroll>


       <Navigation>

      <Link to="/Home">Home</Link>

      <h1 className ="message">welcome to Sports activities finder</h1>

      </Navigation>
      </Header>

      </Header>

<Particles 
         params={particleOpt} />


    </div>
  );
}
}

export default App;
